import React from 'react';
import Input from './Input';

const Form = (props) => {
    return (
        <form onSubmit={props.handler}>
            <h4>{props.isEditForm ? "Editing Bug: " : "Assign Bug: "}</h4>
            <div className="form-group">
                <Input name="bugtitle"
                    placeholder="Enter Bug Title"
                    labelName="Bug Title: "
                    handleChange={props.handleChange}
                    value={props.data.bugname} />
                <Input name="status"
                    placeholder="Status"
                    labelName="Status"
                    handleChange={props.handleChange}
                    value={props.data.Status} />
                <Input name="comment"
                    placeholder="Comment"
                    labelName="Comment: "
                    handleChange={props.handleChange}
                    value={props.data.comment} />
                <Input name="priority"
                    placeholder="Priority"
                    labelName="Priority: "
                    handleChange={props.handleChange}
                    value={props.data.priority} />
            </div>
            <button type="submit" className="btn btn-primary">Submit</button>
        </form>
    )
}

export default Form;
